import {
  FILE_UPLOAD_REQUEST,
  FILE_UPLOAD_SUCCESS,
  FILE_UPLOAD_FAIL,
  FILE_UPLOAD_RESET,
} from "../constants/fileConstant";
import axios from "axios";

const API = process.env.REACT_APP_API;

export const fileUpload = (formData) => async (dispatch) => {
  try {
    //console.log(formData);
    dispatch({ type: FILE_UPLOAD_REQUEST });
    const response = await fetch("/file_upload", {
      method: "POST",
      body: formData,
    });
    if (response.status == 200) {
      response = response.json();
    }
    // .then((result) => result.json())
    // .then((data) => console.log(data));
    dispatch({
      type: FILE_UPLOAD_SUCCESS,
      payload: response.json(),
    });
  } catch (error) {
    dispatch({
      type: FILE_UPLOAD_FAIL,
      payload: error,
    });
  }
};

export const sayHi = () => async (dispatch) => {
  try {
    console.log("calling data");
    const data = await fetch(`/say_hi`)
      .then((response) => response.json())
      .then((data) => console.log(data));

    if (data) {
      console.log(data);
    }
  } catch (e) {
    console.log(e.message);
  }
};
